

// Function to find the node with the minimum distance value
function mindistance(distance, stat) {
    let minimum = Infinity;
    
    // To store the index of the node with the minimum distance
    let ind;
    for (let k = 0; k < 81; k++) {
        if (stat[k] === false && distance[k] <= minimum) {
            minimum = distance[k];
            ind = k;
        }
    }
    return ind;
}
  
// Dijkstra's algorithm implementation
function dijkstra(graph, source, stations) {
    console.log("I am in dikstra function!!!");
    const distance = new Array(81);
    const stat = new Array(81);
    
    // Initialize distance and stat arrays
    for (let k = 0; k < 81; k++) {
        distance[k] = Infinity;
        stat[k] = false;
    }
    
    distance[source] = 0;
    
    // Find the shortest path for all nodes
    for (let k = 0; k < 81; k++) {
        let m = mindistance(distance, stat);
        stat[m] = true;
        
        // Update distance values of adjacent nodes
        for (let k = 0; k < 81; k++) {
        if (!stat[k] && graph[m][k] && distance[m] !== Infinity && distance[m] + graph[m][k] < distance[k])
          distance[k] = distance[m] + graph[m][k];
        }
    }
    
    // Print the shortest distances from the source node to every other node
    console.log(`Minimum number of stations from ${stations[source]} to every other station:`);
    for (let k = 0; k < 81; k++) {
        console.log(`Number of stations from ${stations[source]} To ${stations[k]} are ${distance[k]}`);
    }
}

